$_MODULE['<{export_catalog}prestashop>admin_66ce74c62b0cd9bd8864a95278fed4ea'] = 'Une exportation génère un fichier CSV. Ce type de fichier stocke des données tabulaires (nombre et texte) sous forme de texte brut. Texte brut signifie que le fichier est une séquence de caractères lisible, par opposition aux informations binaires qui ont besoin d\'être interprétées. Un fichier CSV se compose d\'un nombre quelconque d\'enregistrements, séparés par des sauts de ligne quelconque ; chaque enregistrement est composé de champs, séparés par quelque autre caractère ou chaîne, plus souvent une virgule ou une tabulation (texte de Wikipedia).';
$_MODULE['<{export_catalog}prestashop>admin_9b5f1030e3eca6f14f4aee3170f0a7d6'] = 'Un modèle d\'exportation décrit quels produits (enregistrements) il faut exporter et comment les organiser dans le fichier CSV.';
